import { red } from "@mui/material/colors";
import { makeStyles } from "@mui/styles";
import { Theme } from "@mui/material";
export default makeStyles((theme: Theme) => ({
  bottomNavBar: {
    width: 600,
    backgroundColor: "purple",
  },
}));
